function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Header text="PlayerApp" />
          <Route exact path="/" component={ShowPlayer} />
          <Route exact path="/AddPlayer" component={AddPlayer} />
        </Switch>
        {/*
